const initialState = {
    updateUserInformation:null
}

export default function (state = initialState, action) {
    switch (action.type) {
        case 'UPDATE_USER_INFORMATION':
            return {
                ...state,
                updateUserInformation: action.value
            }
        default:
            return state
    }
}
